0:1377:3838.docs:
Receives data from the socket, without removing it from the input queue.
On success, returns the number of bytes read and the address from whence
the data came.

# Notes

On Windows, if the data is larger than the buffer specified, the buffer
is filled with the first part of the data, and peek_from returns the error
WSAEMSGSIZE(10040). The excess data is lost.
Make sure to always use a sufficiently large buffer to hold the
maximum UDP packet size, which can be up to 65536 bytes in size.

# Examples

```no_run
# use std::error::Error;
#
# fn main() -> Result<(), Box<dyn Error>> {
use mio::net::UdpSocket;

let socket = UdpSocket::bind("127.0.0.1:0".parse()?)?;

// We must check if the socket is readable before calling recv_from,
// or we could run into a WouldBlock error.

let mut buf = [0; 9];
let (num_recv, from_addr) = socket.peek_from(&mut buf)?;
println!("Received {:?} -> {:?} bytes from {:?}", buf, num_recv, from_addr);
#
#    Ok(())
# }
```

2:13523:10697.docs:
Returns an iterator over the [`char`]s of a string slice, and their
positions.

As a string slice consists of valid UTF-8, we can iterate through a
string slice by [`char`]. This method returns an iterator of both
these [`char`]s, as well as their byte positions.

The iterator yields tuples. The position is first, the [`char`] is
second.

# Examples

Basic usage:

```
let word = "goodbye";

let count = word.char_indices().count();
assert_eq!(7, count);

let mut char_indices = word.char_indices();

assert_eq!(Some((0, 'g')), char_indices.next());
assert_eq!(Some((1, 'o')), char_indices.next());
assert_eq!(Some((2, 'o')), char_indices.next());
assert_eq!(Some((3, 'd')), char_indices.next());
assert_eq!(Some((4, 'b')), char_indices.next());
assert_eq!(Some((5, 'y')), char_indices.next());
assert_eq!(Some((6, 'e')), char_indices.next());

assert_eq!(None, char_indices.next());
```

Remember, [`char`]s might not match your intuition about characters:

[`char`]: prim@char

```
let yes = "yes";

let mut char_indices = yes.char_indices();

assert_eq!(Some((0, 'y')), char_indices.next()); // not (0, 'y')
assert_eq!(Some((1, '\u{0306}')), char_indices.next());

// note the 3 here - the last character took up two bytes
assert_eq!(Some((3, 'e')), char_indices.next());
assert_eq!(Some((4, 's')), char_indices.next());

assert_eq!(None, char_indices.next());
```

2:13623:3389.docs:
Return an iterator that escapes each char in `self` with [`char::escape_default`].

# Examples

As an iterator:

```
for c in "\n!".escape_default() {
    print!("{c}");
}
println!();
```

Using `println!` directly:

```
println!("{}", "\n!".escape_default());
```


Both are equivalent to:

```
println!("\\u{{2764}}\\n!");
```

Using `to_string`:

```
assert_eq!("\n!".escape_default().to_string(), "\\u{2764}\\n!");
```

